import React, { Component } from "react";
import {
  Dialog,
  DialogActions,
  DialogContent,
  DialogTitle,
  TextField,
  Button,
  withStyles,
} from "@material-ui/core";
import styles from "../TaskForm/styles";
class TaskForm extends Component {
  render() {
    const { onClose, onOpenForm, classes } = this.props;
    return (
      <Dialog
        open={onOpenForm}
        onClose={onClose}
        aria-labelledby="form-dialog-title"
      >
        <DialogTitle id="form-dialog-title">Thêm mới công việc</DialogTitle>
        <DialogContent>
          <TextField
            classes={classes.textField}
            margin="normal"
            id="name"
            label="Name"
          />
          <TextField
            classes={classes.multiline}
            margin="normal"
            id="name"
            label="Description"
            multiline
            rowsMax="4"
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={onClose} color="primary">
            Cancel
          </Button>
          <Button onClick={onClose} color="primary">
            Submit
          </Button>
        </DialogActions>
      </Dialog>
    );
  }
}

export default withStyles(styles)(TaskForm);
